import React, { Component } from 'react';
import {DataTable} from 'primereact/datatable';
import {Column} from 'primereact/column';
import { Card } from 'primereact/card';

class Datatable extends Component {


    render() {
        const { summaryCountries, currentDate } = this.props;
        return (
            <Card>   
            <DataTable value={currentDate}>
            <Column field="country" header="Country" />
            <Column field="year" header="Infected" />
            <Column field="brand" header="Deaths" />
            <Column field="color" header="Recovered" />
        </DataTable>
        {summaryCountries.map((country) => (
         
         <h5 className="card-title">{country.Country}</h5>   
                              
      ))}
        </Card> 
        );
    }
}

export default Datatable;
